import styled from "@emotion/styled";

const Container = styled.div`
  min-height: 50rem;
  flex: 1;
  > h1 {
    text-align: center;
  }
`;

const CategoryResultContianer = styled.div`
  background: white;
  height: 100%;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
`;

export const CategoryList = () => {
  return (
    <Container>
      <h1>Catagories</h1>
      <CategoryResultContianer></CategoryResultContianer>
    </Container>
  );
};
